    [],nt"revision_timestamp": "2013-03-15T12:01:04.889999",nt"name": "field-plot-and-accuracy-assessment-points-for-grand-portage-national-monument-vegetation-mappin",nt"isopen":
    false,nt"url": null,nt"notes": "The vegetation point data for Grand Portage
    National Monument (GRPO) was developed to support two projects associated with the
    2006 vegetation map, the collection of detailed vegetation plot data, and the vegetation
    map's accuracy assessment project. The vegetation plot project was conducted to
    develop the map classification scheme. A total of 23 vegetation plot sites were
    sampled at GRPO. A detailed vegetation analysis of these data along with information
    collected from previous classification projects were used to develop the map classification
    scheme, in accordance with the National Vegetation Classification System. The accuracy
    assessment project was conducted to locate and document potential thematic errors
    (i.e., the assignment of an incorrect map class), specifically user's accuracy (suitability
    for a particular application) and producer's accuracy (conformance to production
    standards). The AA was performed only on map classes representing NVCS natural/semi-natural
    vegetation types. The GRPO vegetation map was determined to have an overall AA of
    91.8% (Kappa index of 90.7%). A total of 147 sites were observed for the accuracy
    assessment project. More detailed results are presented in the GRPO project report
    via a contingency table available on the program's website. The GIS data set contains
    point data features, projected to Universal Transverse Mercator zone 16 mapping
    coordinates, North American Datum 1983.",nt"license_title": null,nt"extras":
